def search_insert(nums, target):
    if not nums:
        return 0
    (low, high) = (0, len(nums) - 1)
    while low < high:
        mid = (low + high) // 2
        if nums[mid] < target:
            low = mid + 1
        else:
            high = mid - 1
    return low

